package com.es.param.result;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import java.util.List;/** * @Date 2023/4/24 10:47 * @author runxiu.li * @Description 订阅配置信息 * 注意需要与es中保持一致 */@Data@Builder@AllArgsConstructor@NoArgsConstructorpublic class EsSubscriptionConfigInfo {    /**     * 车型，必填，单选     */    private String model;    /**     * 车款，选填，多选     */    private List<String> generations;    /**     * 外观颜色（车漆），选填，多选     */    private List<String> carPaints;    /**     * 电池包，选填，多选     */    private List<String> batterys;    /**     * 轮毂，选填，多选     */    private List<String> wheels;    /**     * 内饰材料，选填，多选     */    private List<String> interiorMaterial;    /**     * 内饰颜色（内饰主题），选填，多选     */    private List<String> interiorColor;}